      const fetchMovies = async () => {
        try {
          const response = await axios.get(`https://api.themoviedb.org/3/movie/550?api_key=$`); // Replace with your API endpoint URL
          setMovies([response.data]); // Wrap the response data in an array or modify it to match the expected format of the MovieList component
